INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (301197, '', '2019-09-30 17:30:39.0', 301, '', 'The Devil from Fate.', '/201909/301197.mp3', 'http://staticvip.iyuba.cn/images/voa/301197.jpg', '', '', '《太空旅客》是由美国哥伦比亚电影公司出品的科幻爱情片，该片讲述了五千名太空旅客乘坐阿瓦隆号飞船去往另一个星球开始新的生活，不料在途中飞船遭遇意外，旅客们将面对飞船即将崩溃的危险。', '《太空旅客》：来自命运的恶意', '', 4, 260, 0, '/video/voa/301/301197.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (301198, '', '2019-10-10 16:20:30.0', 301, '', 'Hollow Crown.', '/201910/301198.mp3', 'http://staticvip.iyuba.cn/images/voa/301198.jpg', '', '', '《空王冠：玫瑰战争》是根据莎士比亚同名剧集改编拍摄，由本尼迪克特·康伯巴奇饰演理查三世，首张角色剧照里，"卷福"变身英格兰国王征战沙场气场全开。', '《空王冠：玫瑰战争》', '', 2, 184, 0, '/video/voa/301/301198.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (301199, '', '2019-10-15 15:49:00.0', 301, '', 'Star Trek 3: Beyond the Stars.', '/201910/301199.mp3', 'http://staticvip.iyuba.cn/images/voa/301199.jpg', '', '', '《星际迷航3：超越星辰》的背景设定于《暗黑无界》之后，讲述了科克船长带领着企业号船员们到一个未知的星域去解救失事的飞船，却在途中遭遇了当地种族袭击的故事。', '《星际迷航3：超越星辰》', '', 4, 155, 0, '/video/voa/301/301199.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (301200, '', '2019-10-17 17:21:06.0', 301, '', 'I really, really admire your grit.', '/201910/301200.mp3', 'http://staticvip.iyuba.cn/images/voa/301200.jpg', '', '', '《蜘蛛侠：英雄归来》（Spider-Man:Homecoming）是2017年漫威影业与哥伦比亚影业联合出品，索尼电影娱乐公司发行的一部科幻动作电影，由乔恩·沃茨执导，汤姆·赫兰德、迈克尔·基顿、小罗伯特·唐尼、玛丽莎·托梅、雅各·巴塔伦、乔恩·费儒、劳拉·海瑞尔、赞达亚·科尔曼等主演。', '我真佩服你的勇气！', '', 3, 240, 0, '/video/voa/301/301200.mp4');
