INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (309607, '', '2019-10-19 15:00:17.0', 309, '', 'A princess strives for... Well, perfection..', '/201910/309607.mp3', 'http://staticvip.iyuba.cn/images/voa/309607.jpg', '', '', '《勇敢传说》是2012年一部美国迪士尼·皮克斯出品的动画电影。电影由皮克斯动画工作室制作并由迪士尼影业负责发行。影片由马克∙安德鲁斯与布兰达∙查普曼联合导演，凯瑟琳∙萨拉斐安监制，凯莉·麦克唐纳、艾玛·汤普森和凯文·麦克基德为影片配音。影片于2012年6月19日在中国内地上映。', '公主要追求完美', '', 4, 499, 0, '/video/voa/309/309607.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (309608, '', '2019-10-23 16:55:26.0', 309, '', 'You might be chewing on a screw.', '/201910/309608.mp3', 'http://staticvip.iyuba.cn/images/voa/309608.jpg', '', '', '开心汉堡店，是指在Fox新动画剧《开心汉堡店》（Bob’s Burgers）中，Bob Belcher（H. Jon Benjamin配音）在妻子和三个孩子的帮助下经营的家族餐馆（鲍勃汉堡店）。快来看看发生了什么吧。', '有颗螺丝可能被您吃掉了', '', 3, 209, 0, '/video/voa/309/309608.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (309609, '', '2019-10-29 14:39:11.0', 309, '', 'The Ceramics Room.', '/201910/309609.mp3', 'http://staticvip.iyuba.cn/images/voa/309609.jpg', '', '', 'Bob’s Burgers是FOX电视台即将在2011年冬春季档推出的一部卡通剧集，故事讲述Bob一家人与自己经营的一家汉堡餐馆之间的故事。', '寻找消失的陶艺室', '', 4, 153, 0, '/video/voa/309/309609.mp4');
