INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310038, '', '2019-08-14 18:32:36.0', 310, '', 'Try.', '/201908/310038.mp3', 'http://staticvip.iyuba.cn/images/voa/310038.jpg', '', '', '《Try》为 蔻比·凯蕾2014年9月30日专辑【Gypsy Heart】主打曲。在吉他与钢琴相伴的舒缓旋律中呼吁女生拥抱天生美感的重要性，不要在意身体外表，更不要为了取悦他人而失去真实自我，获选为iTunes美国每周单曲，音乐录像带在YouTube/VEVO涌入超过2400万名乐迷点听，歌曲晋升全美抒情榜第16名，告示牌杂志盛赞这是一首鼓舞年轻女孩拥有更强自我价值观的歌曲。', '英文歌曲Try', '', 3, 393, 0, '/video/voa/310/310038.mp4');
