INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310040, '', '2019-08-24 14:57:15.0', 310, '', 'Oh life.', '/201908/310040.mp3', 'http://staticvip.iyuba.cn/images/voa/310040.jpg', '', '', '你知道英文版的《后来》是怎么唱的吗？', '《后来》英文版', '', 3, 443, 0, '/video/voa/310/310040.mp4');
