INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310042, '', '2019-09-03 17:12:11.0', 310, '', 'Remember Me.', '/201909/310042.mp3', 'http://staticvip.iyuba.cn/images/voa/310042.jpg', '', '', '“请记住我吧，虽然我要说再见了；就算我远行，我也将你放在心里。”来听一听非常温暖的《寻梦环游记》主题曲吧！', '请记住我', '', 3, 459, 0, '/video/voa/310/310042.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310043, '', '2019-09-11 16:57:50.0', 310, '', 'Imagine.', '/201909/310043.mp3', 'http://staticvip.iyuba.cn/images/voa/310043.jpg', '', '', 'Imagine是一首轻摇滚音乐，由英格兰音乐家约翰·列侬创作并演唱，是他独唱生涯最佳销售单曲。歌词意味新奇，挑战听众去想象一个没有宗教派别、民族界限造成的战火与隔阂的世界，并且讨论了人们生活在更少物质财富世界的可能性。', '英文歌曲Imagine', '', 3, 222, 0, '/video/voa/310/310043.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310044, '', '2019-09-19 16:32:07.0', 310, '', 'Take Me to Church.', '/201909/310044.mp3', 'http://staticvip.iyuba.cn/images/voa/310044.jpg', '', '', '《Take Me To Church》是由爱尔兰歌手Hozier演唱的一首歌曲，收录于EP专辑《Take Me To Church》及录音室专辑《Hozier》中。歌曲由霍齐尔创造、罗布·柯万制作，于2013年9月16日由小岛唱片和Rubyworks唱片共同发行。该首歌被选用为《Powerbeats 2 Wireless》广告宣传片的背景音乐。', 'Take Me to Church', '', 4, 236, 0, '/video/voa/310/310044.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310045, '', '2019-10-08 17:33:27.0', 310, '', 'Blank Space.', '/201910/310045.mp3', 'http://staticvip.iyuba.cn/images/voa/310045.jpg', '', '', '《Blank Space》被收录在泰勒·斯威夫特于2014年10月27日发行的第五张录音室专辑《1989》，并作为推广该专辑的第二支单曲，于2014年11月10日开始通过大机器唱片公司发行.', '听歌《Blank space》', '', 3, 286, 0, '/video/voa/310/310045.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310046, '', '2020-03-04 13:51:11.0', 310, '', 'Love Me or Not.', '/201910/310046.mp3', 'http://staticvip.iyuba.cn/images/voa/310046.jpg', '', '', '《不爱我就拉倒》是由周杰伦、宋健彰作词，周杰伦作曲并演唱的歌曲。该曲于2018年5月15日以单曲的形式发布。那么你听歌英文版的吗？', '《不爱我就拉倒》英文版', '', 3, 212, 0, '/video/voa/310/310046.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310047, '', '2019-10-26 16:00:37.0', 310, '', 'Fly me to the moon.', '/201910/310047.mp3', 'http://staticvip.iyuba.cn/images/voa/310047.jpg', '', '', 'Fly Me To The Moon 由巴特·霍华德(Bart Howard)应发行商创作单曲要求，创作于1954年。是首华尔兹舞曲，也是他最有名的一首作品。最初由当时他工作的酒店的驻店歌手Felicia Sanders演唱。', 'Fly me to the moon', '', 4, 336, 0, '/video/voa/310/310047.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310048, '', '2019-11-02 16:36:00.0', 310, '', 'Jenny of Oldstones.', '/201911/310048.mp3', 'http://staticvip.iyuba.cn/images/voa/310048.jpg', '', '', '这首《Jenny of Oldstones》第一次被唱响则是在《权力的游戏》S8E2 中，大战前夜围坐在炉火旁的小恶魔、戴弗斯、布蕾妮、托蒙德、詹姆、波德瑞克等人，喝光了最后一滴红酒。', 'Jenny of Oldstones', '', 4, 528, 0, '/video/voa/310/310048.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310049, '', '2019-11-09 16:49:34.0', 310, '', 'Trouble is a friend.', '/201911/310049.mp3', 'http://staticvip.iyuba.cn/images/voa/310049.jpg', '', '', '《Trouble is a friend》 [1]  来自澳洲Electronic-Rock团体Decoder Ring中的优质创作甜美女歌手Lenka演唱。该歌曲由Thomas Salter作词作曲，收录于专辑《Lenka》中，发行于2008年9月。动员Stuart Brawley、Pierre Marchand、Mike Elizondo、John Alagia、Jason Lader等五位当红制作人联手打造。', '歌曲：Trouble is a friend', '', 3, 126, 0, '/video/voa/310/310049.mp4');
INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310050, '', '2019-11-15 15:00:36.0', 310, '', 'The theme song of Beauty and the Beast.', '/201911/310050.mp3', 'http://staticvip.iyuba.cn/images/voa/310050.jpg', '', '', '听一听吧，这是迪士尼动画电影《美女与野兽》的主题曲', '《美女与野兽》主题曲', '', 3, 171, 0, '/video/voa/310/310050.mp4');
