INSERT INTO voa (voaId, introDesc, createTime, category, keyword, title, sound, pic, pageTitle, url, descCn, titleCn, publishTime, hotFlg, readCount, series, video) VALUES (310052, '', '2019-12-02 18:25:11.0', 310, '', 'Black or white', '/201912/310052.mp3', 'http://staticvip.iyuba.cn/images/voa/310052.jpg', '', '', '《Black or White》是美国流行歌手迈克尔·杰克逊填词与谱曲，并与美国说唱歌手L.T.B.所演唱的歌曲，由迈克尔·杰克逊创作，比尔·波特雷制作，收录在专辑《Dangerous》中，于1991年10月11日由史诗唱片全球发行。', '英文歌曲：Black or White', '', 4, 135, 0, '/video/voa/310/310052.mp4');
